import React, { Component } from 'react'

export class BlogDetail extends Component {
    constructor(props){
        super()
        this.idBlog = props.match.params.id;
    }
    render(props) {
        console.log(this.idBlog)
        return (
            <div>
                Blog Detail
            </div>
        )
    }
}

export default BlogDetail
